import './index.scss';
import {Link, NavLink, useNavigate} from "react-router-dom";
import { useEffect, useState } from "react";


const Navbar = () => {

    const [username, setUsername] = useState('Placeholder Name');

    useEffect( () => {
        (async () => {
            const getName = await fetch('https://username-generator-api.glique.repl.co/gen', {
                method: 'GET',
                headers: {
                    'Content-Type': 'application/json'
                }
            }).then((res) => res.json());

            console.log(getName);
        })();

        // Stupid CORS policy not letting me fetch from here
        // Implement socket and route the fetch through backend server
    });

    return (
        <section id={'nav'}>
            <NavLink to={'/'} id={'logo'}>
                Card Me Daddy
            </NavLink>

            <form className={'change-name'}>
                <input type={'text'} placeholder={ username }/>
                <input type={'submit'} value={'Change Name'}/>
            </form>
        </section>
    );
};

export default Navbar;
